import { Menu, } from 'antd';
import React, { Component } from 'react';
import { Link } from "mirrorx";
import {
  PieChartOutlined,
  DesktopOutlined,
  ContainerOutlined,
  MailOutlined,
} from '@ant-design/icons';

import './leftmenu.less';
const { SubMenu } = Menu;
class Leftmenu extends Component {
  constructor(props) {
    super(props);
    this.state = { }
  }

  render() {
    return (
      <Menu defaultSelectedKeys={['mypage']} mode="inline"  >
        <SubMenu key="sub1" icon={<MailOutlined />} title="subnav 1">
          <Menu.Item key="option1" icon={<PieChartOutlined />}>
            < Link to="/pageOption1" > Option 1</Link>
          </Menu.Item>
          <Menu.Item key="option2" icon={<DesktopOutlined />}>
            < Link to="/pageOption2" >Option 2</Link>
          </Menu.Item>
          <Menu.Item key="option3" icon={<ContainerOutlined />}>
            < Link to="/pageOption3" >Option 3</Link>
          </Menu.Item>
          <Menu.Item key="mypage" icon={<ContainerOutlined />}>
            < Link to="/mypage" >mytest</Link>
          </Menu.Item>
        </SubMenu>
      </Menu>


    );
  }
}
export default Leftmenu;
